package arrays;

public class MultiDimExample {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
int a[][]={{1,2,3},{5,6,7},{8,9,12}};
for(int i=0;i<a.length;i++){
	for(int j=0;j<a.length;j++){
		System.out.println(a[i][j]+" ");
	}

System.out.println();
	
}

	}

}
